(97, 34, 'Sa Ra Mt - Cleansing Foam', 'Sa Ra Mt Go Rice Warer Bright Rice Bran Cleansing Foam', 'sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam', 'Xut x : Thefaceshop - Korea.\r\nSa Ra Mt Go loai bo t bao cht v lm sch, sng da.', '<p><span style="font-size: medium;"><a title="Sa Ra Mt Go Rice Warer Bright Rice Bran Cleansing Foam" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong>Sa Ra Mt Go Rice Warer Bright Rice Bran Cleansing Foam</strong></a></span></p>\r\n<p><span style="font-size: medium;"><a title="Sa ra mt go gi&uacute;p loai bo t&ecirc; bao ch&ecirc;t" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong>Sa ra mt go gi&uacute;p loai bo t&ecirc; bao ch&ecirc;t</strong></a> nhe nhang,<a style="font-size: small;" title="l&agrave;m sch v&agrave; s&aacute;ng da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong> l&agrave;m sch v&agrave; s&aacute;ng da</strong></a>, lu lai &ocirc; &acirc;m cho da sau khi s dung.</span></p>\r\n<p><span style="font-size: medium;">C&aacute;ch s dng:&nbsp;</span></p>\r\n<p><span style="font-size: medium;">S dng sau ty trang. To bt sn phm, massage khong 30 gi&acirc;y n 1 ph&uacute;t v&agrave; ra sch li vi nc.</span></p>', '2014_02_28_13_49_53-shopmyphamhan-Sua-rua-mat-gao-rice-water-bright-rice-bran-cleansing-foam.jpg', NULL, 185000, 'SRMTFS2', 1, '0', 0, 0, '0', '1', '1', 1393567001),
