(122, 64, 'Ty Da Cht - Peeling', 'Ty da cht Ngc Trai Thefaceshop White Jewel Smart Peeling  ', 't-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling', 'Xut x : Thefaceshop - Korea.\r\nTy t bo cht Ngc Trai tac dung lam trng da.', '<p><span style="font-size: medium;"><strong>T<a title="Kem t&acirc;y da cht Ngc Trai Thefaceshop White Jewel Smart Peeling " href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling">&acirc;y da cht Ngc Trai Thefaceshop White Jewel Smart Peeling&nbsp; </a></strong></span></p>\r\n<p><span style="font-size: medium;">Trng lng: 120ml</span></p>\r\n<p><span style="font-size: medium;">White Jewel Smart Peeling c <a title="pha trn vi bt ngc trai nh nh&agrave;ng loi b t b&agrave;o da c" href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling"><strong>pha trn vi bt ngc trai nh nh&agrave;ng loi b t b&agrave;o da c</strong></a> v&agrave; c&aacute;c tp cht m&agrave; n s&acirc;u b&ecirc;n trong l ch&acirc;n l&ocirc;ng  tng cng s hp thu tt hn v dinh dng cung cp chm s&oacute;c l&agrave;n da ca bn. Tun ho&agrave;n m&aacute;u ca bn s c ci thin t massage v&ograve;ng tr&ograve;n ,sau khi s dng <a title="l&agrave;n da ca bn s trng s&aacute;ng" href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling"><strong>l&agrave;n da ca bn s trng s&aacute;ng</strong></a> l&ecirc;n vi &aacute;nh s&aacute;ng t nhi&ecirc;n l&agrave;nh mnh.</span><br /><br /><span style="font-size: medium;">Hng dn s dng:</span></p>\r\n<p><span style="font-size: medium;">Ly kem va  v&agrave; xoa b&oacute;p tr&ecirc;n da bn t 3 ~ 5 ph&uacute;t (tr&aacute;nh mt v&agrave; m&ocirc;i). Ra sch vi nc. Tr&aacute;nh c&aacute;c vt thng v&agrave; ph&aacute;t ban.</span></p>\r\n<p><span style="font-size: medium;">- i vi da du, s dng 1 ~ 2 ln mi tun.</span></p>\r\n<p><span style="font-size: medium;">- i vi da thng, da kh&ocirc; s dng mi tun mt ln.</span></p>\r\n<p><span style="font-size: medium;">