h&ocirc; khi ngi trong m&aacute;y lnh.</span></p>\r\n<p><span style="font-size: medium;">7. Gi&uacute;p tr&aacute;nh b try da khi co l&ocirc;ng hoc co r&acirc;u: bng c&aacute;ch thoa 1 lp gel trc khi co.</span></p>\r\n<p><span style="font-size: medium;">8. L&agrave;m du da sau khi i nng, tm bin hoc sau khi wax l&ocirc;ng.</span></p>', '2014_04_08_14_58_11-shopmyphamhan-gel-lo-hoi-aloe-vera-soothing-gel-92.jpg', NULL, 130000, 'MASKNR1', 1, '0', 0, 0, '0', '1', '1', 1396943491);
